    (function(document, window, $){
      'use strict';
      $(document).ready(function(){
        if (window.appState.DeveloperMode) {
          $(document).click(function() {
            if (performance) {
              console.log("Click", performance.now());
            }
          });
          $(document).keypress(function() {
            if (performance) {
              console.log("Key", performance.now());
            }
